import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { FaHeart, FaUser, FaShoppingCart, FaSearch, FaMinus, FaPlus } from 'react-icons/fa';
import { useNavigate } from 'react-router-dom';
import './Electronics.css';

function Electronics() {
  const navigate = useNavigate();
  const handleHome = () => {
    navigate('/Home');
  }
  const handleClothing = () => {
    navigate('/Clothing');
  }
  const handleCart = () => {
    navigate('/Cart');
  }
  const handleProfile = () => {
    navigate('/Profile');
  }
  const [products, setProducts] = useState({phones: [], laptops: [], accessories: []});

  useEffect(() => {
    const fetchProducts = async () => {
      try {
        const response = await axios.get('http://localhost:8000/api/products/');
        const electronics = response.data.electronics;

        const phones = electronics.filter(product => product.name.toLowerCase().includes('iphone') || product.name.toLowerCase().includes('samsung'));
        const laptops = electronics.filter(product => product.name.toLowerCase().includes('macbook') || product.name.toLowerCase().includes('thinkpad') || product.name.toLowerCase().includes('dell'));
        const accessories = electronics.filter(product => !phones.includes(product) && !laptops.includes(product));

        setProducts({phones, laptops, accessories});
      } catch (error) {
        console.error('Error fetching products:', error);
      }
    };

    fetchProducts();
  }, []);

  const [cartItems, setCartItems] = useState({});

  const addToCart = (productName) => {
    setCartItems((prevItems) => ({
      ...prevItems,
      [productName]: (prevItems[productName] || 0) + 1,
    }));
  };

  const increaseQuantity = (productName) => {
    setCartItems((prevItems) => ({
      ...prevItems,
      [productName]: prevItems[productName] + 1,
    }));
  };

  const decreaseQuantity = (productName) => {
    setCartItems((prevItems) => ({
      ...prevItems,
      [productName]: Math.max(0, prevItems[productName] - 1),
    }));
  };

  // Helper function to render the add to cart or quantity buttons
  const renderCartButton = (productName) => {
    const count = cartItems[productName] || 0;
    return count > 0 ? (
      <div className="quantity-controls" style={{marginLeft:"40px"}}>
        <button  onClick={() => decreaseQuantity(productName)}><FaMinus /></button>
        <span >{count}</span>
        <button  onClick={() => increaseQuantity(productName)}><FaPlus /></button>
      </div>
    ) : (
      <button style={{marginLeft:"40px"}}  className="add-to-cart-button" onClick={() => addToCart(productName)}>
        Add to Cart <FaShoppingCart />
      </button>
    );
  };

  // Function to render products based on category
  const renderCategory = (category) => (
    <section className="Electronics-section">
      <h2>{category.charAt(0).toUpperCase() + category.slice(1)}</h2>
      <div className="product-grid">
        {products[category].map(product => (
          <div className="product-card" key={product.name}>
            <img src={product.url} alt={product.name} />
            <h3>{product.name}</h3>
            <div style={{display: 'flex', marginTop: "10px"}}>
              <p>${product.price}</p>
              <div style={{marginLeft: 'auto'}}>
                {renderCartButton(product.name)}
                </div>
            </div>
          </div>
        ))}
      </div>
    </section>
  );

  return (
    <div className="Electronics">
      {/* Header and Navigation */}
      <main className="Electronics-main">
        {renderCategory('phones')}
        {renderCategory('laptops')}
        {renderCategory('accessories')}
      </main>
      {/* Footer */}
    </div>
  );
}

export default Electronics;
